import React from "react"

const Register = () => {
    return (
        <div>
            <h1>Registar</h1>
            <input type="text" placeholder="Nome"></input>
            <input type="password" placeholder="Password"></input>
            <input placeholder="Nome"></input>
        </div>
    )
}

export default Register
